import React, { useState } from 'react';
import { Text, View, Image, ImageBackground, TouchableOpacity, TextInput } from "react-native";

import { images, colors, icons, fontSizes } from '../constants';

const Login = (props: any) => {
    return (
        <View
            style={{
                flex: 1,
                backgroundColor: 'white'
            }}
        >
            <View
                style={{
                    height: 200,
                    flexDirection: 'row',
                    justifyContent: 'space-around',
                    alignItems: 'center',
                    flex: 30
                }}
            >
                <Text
                    style={{
                        color: 'black',
                        fontSize: fontSizes.h1,
                        fontWeight: 'bold',
                        width: '50%'
                    }}
                >
                    Already have an Account
                </Text>
                <Image
                    source={images.computer}
                    style={{
                        width: 120,
                        height: 120,
                        tintColor: colors.primary,
                        alignSelf: 'center'
                    }}
                />
            </View>
            <View
                style={{
                    flex: 30
                }}
            >
                <View
                    style={{
                        marginHorizontal: 15,
                        marginVertical: 10
                    }}
                >
                    <Text
                        style={{
                            fontSize: fontSizes.h6,
                            color: colors.primary
                        }}
                    >
                        Email:
                    </Text>
                    <TextInput
                        placeholder='example@gmail.com'
                        placeholderTextColor={colors.placeholder}
                        style={{
                            color: 'black',

                        }}
                    />
                </View>
                <View
                    style={{
                        marginHorizontal: 15,
                        marginVertical: 10
                    }}
                >
                    <Text
                        style={{
                            fontSize: fontSizes.h6,
                            color: colors.primary
                        }}
                    >
                        Password:
                    </Text>
                    <TextInput
                        placeholder='Enter you password'
                        placeholderTextColor={colors.placeholder}
                        secureTextEntry={true}
                        style={{
                            color: 'black'
                        }}
                    />
                </View>
            </View>
            <View
                style={{
                    flex: 20
                }}
            >
                <TouchableOpacity
                    style={{
                        backgroundColor: colors.primary,
                        justifyContent: 'center',
                        alignItems: 'center',
                        width: '50%',
                        alignSelf: 'center',
                        borderRadius: 17
                    }}
                    onPress={() => {
                        alert("Press Login");
                    }}
                >
                    <Text
                        style={{
                            padding: 8,
                            color: '#fff',
                            fontSize: fontSizes.h5
                        }}
                    >
                        Login
                    </Text>
                </TouchableOpacity>
                <TouchableOpacity
                    style={{
                        padding: 5
                    }}
                    onPress={() => {
                        alert("Press Register");
                    }}
                >
                    <Text
                        style={{
                            padding: 8,
                            color: colors.primary,
                            fontSize: fontSizes.h5,
                            alignSelf: 'center'
                        }}
                    >
                        New user? Register now
                    </Text>
                </TouchableOpacity>
            </View>
            <View
                style={{
                    flex: 25,
                    flexDirection: 'row',
                    backgroundColor: 'purple',
                    justifyContent: 'space-around'
                }}
            >
                <View
                    style={{

                    }}
                >

                </View>
            </View>
        </View>
    )
}
export default Login
